import { BrowserRouter, Switch, Route } from 'react-router-dom';

import Navbar from './client/Navbar/components/Navbar';

import HomePage from './client/HomePage';
import ContactsPage from './client/Contacts/pages/ContactsPage/ContactsPage';
import RegisterPage from './client/RegisterPage';
import LoginPage from './client/LoginPage';
import NotFoundPage from './client/NotFoundPage';

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Switch>
        <Route exact path="/" component={HomePage} />
        <Route exact path="/contacts" component={ContactsPage} />
        <Route exact path="/contacts" component={RegisterPage} />
        <Route exact path="/contacts" component={LoginPage} />
        <Route component={NotFoundPage} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
